import React from 'react';
import AIRobot from './AIRobot';
import ChatBubble from './ChatBubble';
import BottomNavigation from './BottomNavigation';
import './AstroBotUI.css';

const AstroBotUI = () => {
  return (
    <div className="astrobot-container">
      {/* Header Section */}
      <div className="header-section">
        <div className="logo-container">
          <img src="/logo.png" alt="AstroBot Logo" className="logo" />
        </div>
        <h1 className="header-title">
          Your <span className="ai-text">âœ¨ AI</span> Companion for Everyday
        </h1>
      </div>

      {/* Central Section with Robot and Chat */}
      <div className="central-section">
        <AIRobot />
        <ChatBubble />
      </div>

      {/* Bottom Navigation */}
      <BottomNavigation />
    </div>
  );
};

export default AstroBotUI;
